import React, { Component } from "react";

export default class counter extends Component {
  constructor() {
    super();

    this.currentCounter = 2;
  }

  render() {
    return (
      <div>
        <button>-</button>
        <span>{this.currentCounter}</span>
        <button>+</button>
      </div>
    );
  }
}
